 We can use React Context to create a scope context for the Tooltip component.

## Create a Tooltip Context

Create a TooltipContext.tsx file in the components folder.
```
import { createContext, useContext } from "react";

const TooltipContext = createContext<{
  close: () => void;
}>({
  close: () => {},
});

export const useTooltipContext = () => useContext(TooltipContext);

export default TooltipContext;
```
## Create a Tooltip Provider

Create a TooltipProvider.tsx file in the components folder.
```
import { ReactNode, useState } from "react";
import TooltipContext from "./TooltipContext";

type Props = {
  children: ReactNode;
};

const TooltipProvider = ({ children }: Props) => {
  const [open, setOpen] = useState(false);

  const close = () => {
    setOpen(false);
  };

  return (
    <TooltipContext.Provider value={{ close }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
## Create a Tooltip Component

Create a Tooltip.tsx file in the components folder.
```
import { ReactNode, useState } from "react";
import TooltipContext from "./TooltipContext";

type Props = {
  children: ReactNode;
  content: ReactNode;
};

const Tooltip = ({ children, content }: Props) => {
  const [open, setOpen] = useState(false);
  const { close } = useTooltipContext();

  const handleOpen = () => {
    setOpen(true);
    close();
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div className="relative">
      <div
        className="cursor-pointer"
        onMouseEnter={handleOpen}
        onMouseLeave={handleClose}
      >
        {children}
      </div>
      {open && (
        <div className="absolute top-0 left-0 z-10">
          <div className="bg-white rounded shadow p-2">{content}</div>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
## Use the Tooltip Component

Use the Tooltip component in the App.tsx file.
```
import Tooltip from "./components/Tooltip";
import TooltipProvider from "./components/TooltipProvider";

const App = () => {
  return (
    <TooltipProvider>
      <div className="flex flex-col items-center justify-center h-screen">
        <Tooltip content="Hello World">
          <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Hover me
          </button>
        </Tooltip>
        <Tooltip content="Hello World">
          <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Hover me
          </button>
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```
## Conclusion

We have created a Tooltip component that can be used in different places but don't have a scope context and are therefore isolated from itself. We have used React Context to create a scope context for the Tooltip component.

